" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Breastfeeding: Parental education and support",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?41/39/42616/contributors\">",
"     Authors",
"    </a>",
