"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification of primary malignant bone tumors",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        I. Osteosarcoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        A. Intramedullary high grade (conventional)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Osteoblastic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Chondroblastic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Fibroblastic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Mixed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        5. Small cell",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        6. Other (telangiectatic, epithelioid, chondromyxoid fibroma-like, chondroblastoma-like, osteoblastoma-like, giant cell rich)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Intramedullary low grade",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C. Juxtacortical high grade (high grade surface osteosarcoma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        D. Justacortical intermediate grade chondroblastic (periosteal osteosarcoma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        E. Juxtacortical low grade (parosteal osteosarcoma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        II. Chondrosarcoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        A. Intramedullary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Conventional (hyaline/myxoid)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Clear cell",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Dedifferentiated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Mesenchymal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Juxtacortical",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        III. Primitive neuroectodermal tumor/Ewing's sarcoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        IV. Angiosarcoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. Conventional",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Epithelioid hemangioendothelioma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        V. Fibrosarcoma/malignant fibrous histiocytoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        VI. Chordoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. Conventional",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Dedifferentiated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        VII. Adamantinoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. Conventional",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Well differentiated-osteofibrosis dysplasia-like",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        VIII. Other",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. Liposarcoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Leiomyosarcoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C. Malignant peripheral nerve sheath tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        D. Rhabdomyosarcoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        E. Malignant mesenchymoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        F. Malignant hemangiopericytoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G. Sarcoma, NOS*; primary malignant lymphoma; and multiple myeloma are not included",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * NOS: not otherwise specified.",
"    </div>",
"    <div class=\"reference\">",
